// src/firebase.js
import { initializeApp } from 'firebase/app';
import { getFirestore } from 'firebase/firestore';
import { getAuth } from 'firebase/auth';

const firebaseConfig = {
  apiKey: "AIzaSyCNo5vw52jaMXeWKIZcbo0BPsEhMKaLcPQ",
  authDomain: "carpore-store.firebaseapp.com",
  projectId: "carpore-store",
  storageBucket: "carpore-store.firebasestorage.app",
  messagingSenderId: "751519323611",
  appId: "1:751519323611:web:7345f81bf7b09003fdc3fe"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

// Initialize Firebase services
export const db = getFirestore(app);
export const auth = getAuth(app);

export default app;
